import './App.css';

import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default class App extends Component {

  render() {
    return (
      <div>
        <Router>
        <Navbar/>
        <Switch>
          <Route path="/"><News pageSize={6} category= "Business"/></Route>
          <Route path="/"><News pageSize={6} category= "Entertainment"/></Route>
          <Route path="/"><News pageSize={6} category= "General"/></Route>
          <Route path="/"><News pageSize={6} category= "Health"/></Route>
          <Route path="/"><News pageSize={6} category= "Science"/></Route>
          <Route path="/"><News pageSize={6} category= "Sports"/></Route>
          <Route path="/"><News pageSize={6} category= "Sports"/></Route>
        </Switch>
        </Router>
      </div>

    )
  }
}
